      return (
        <div className="flex justify-center items-center ">
            <div className="w-263.75 h-148.5 bg-blue-250">

                <div className=" flex w-7.25 h-7.25 mt-6 right 0">
                    <img className="absolute right-139" src={closeimg} alt=""/>
                </div>












                </div>

            </div>

      )
}
export default ContactModal
